import React from 'react'
import Header from './Header'

const Layout = ({children}) => {
  return (
    <div>
      <h1>Layout</h1>
      <Header/>
      <main style={{minHeight:"80vh"}}>
        {children}
        
      </main>
      <footer/>
    </div>
  )
}

export default Layout
